import React from 'react';
import IC1 from '.src/Images/IC1.jpg';
import IC2 from '.src/Images/IC2.jpg';
import IC3 from '.src/Images/IC3.jpg';
import IC4 from '.src/Images/IC4.jpg';
import IC5 from '.src/Images/IC5.jpg';
import IC6 from '.src/Images/IC6.jpg';

function Footer() {

  const FooterImg = [
    { img: IC1, id: 1 },
    { img: IC2, id: 2 },
    { img: IC3, id: 3 },
    { img: IC4, id: 4 },
    { img: IC5, id: 5 },
    { img: IC6, id: 6 },
    // { img: IC7, id: 7 },
  ];

  return (
    <div className="flex">
      {FooterImg.map((imgs) => (
        <img key={imgs.id} src={imgs.img} alt="img description" />
      ))}
    </div>
  );
}

export default Footer;
